window.bookSummaryJSON = "<p>They're waiting for you.</p> <p>Those four words should have been a warning. They should have filled Violet with dread. But she was so focused on Rafe's disappearance, she forgot.</p> <p>The resistance was supposed to be fighting for a better world. A group of freedom fighters formed during the Monarch War, pushing back against laws that would see everyone enslaved. For a while there, they gave hope.</p> <p>But with power comes corruption. The Society has been quietly amassing the strength and backing to become a real threat, and not everyone wants to use that power for good.</p> <p>In a world torn apart by the death of monarchs, new leaders rise. Violet dives headfirst into the viper's nest with one singular goal: Rescue the stolen prince who possesses half her heart.</p> <p>With the unwavering support of Jordan at her side, Violet knows she can face whatever the resistance throws at them. Even if she was the intended target all along.</p> <p>Keep your friends close.</p> <p>Keep your enemies closer.</p> <p>Never forget the betrayals of the past.</p> <p>The end of an era is here.</p>"; 
